import React from "react";

export const ChildInMenuItem = (
  onMouseEnterHandler,
  onMouseLeaveHandler,
  onMouseDownHandler
) => {
  return (
    <li
      className="in-menu-item"
      onMouseEnter={onMouseEnterHandler}
      onMouseLeave={onMouseLeaveHandler}
      onClick={() => onMouseDownHandler("Savunma")}
    >
      savunma
    </li>
  );
};
